package __CodeHelp.String;

import java.util.HashSet;
import java.util.Set;

public class CountPlaindrome {
	/***
	 * 1930. Unique Length-3 Palindromic Subsequences The time complexity of this
	 * solution is O(n^2) due to the nested loops, where n is the length of the
	 * input string. The space complexity is O(1) for the count variable and O(26)
	 * for the lastIndex array, making it O(27) or simply O(1) in big-O notation.
	 */
	public static void main(String[] args) {
		System.out.println(countPalindromicSubsequence(
				""));

	}

	public static int countPalindromicSubsequence(String s) {
		// Initialize a counter to keep track of the count of palindromic subsequences
		int count = 0;

		// Initialize an array to store the last index of each character
		boolean[] lastIndex = new boolean[26];

		// Iterate through the string (up to the second-to-last character)
		for (int i = 0; i < s.length() - 1; i++) {
			// Check if the character has not been processed before
			if (!lastIndex[s.charAt(i) - 'a']) {
				// Find the last occurrence of the current character in the string
				int lastInd = s.lastIndexOf(s.charAt(i));

				// Initialize a temporary index for iteration
				int temp = i + 1;

				// Use a set to keep track of unique characters in the substring between i and
				// lastInd
				Set<Character> set = new HashSet<>();

				// Iterate through the substring between i and lastInd
				while (temp < lastInd) {
					// If the character is not already in the set, it is part of a palindromic
					// subsequence
					if (set.add(s.charAt(temp))) {
						count++;
					}
					temp++;
				}

				// Mark the current character as processed by updating the lastIndex array
				lastIndex[s.charAt(i) - 'a'] = true;
			}
		}

		// Return the count of palindromic subsequences
		return count;
	}

}
